import styled from "styled-components";
import { COLORS } from "../../constants";

const Wrapper = styled.div`
    background-color: ${COLORS.neutral.blueCard};
    padding: 32px;
    border-radius: 16px;
`;

const ImageWrapper = styled.div`
    border-radius: 8px;
    overflow: hidden;
`;

const Title = styled.h2`

`;


function Card() {
    return (
        <Wrapper>
            <ImageWrapper>
                <img src="images/equilibrium.jpg" alt="equilibrium" />
            </ImageWrapper>
            <Title>Equilibrium #3429</Title>
        </Wrapper>
    )
};

export default Card;
